&lt;div style=&quot;text-align: justify;&quot;&gt;&lt;strong&gt;CEL NAUKOWY&lt;/strong&gt;: Celem artykułu jest opisanie sposobu rozumienia pojęcia „władza” przez menedżerów różnych narodowości, identyfikacja wykorzystywanych przez nich źródeł władzy i sposobów sprawowania władzy, oraz określenie wpływu władzy menedżerów na różne obszary zarządzania ludźmi w zróżnicowanym kulturowo środowisku pracy.&lt;/div&gt;
&lt;div style=&quot;text-align: justify;&quot;&gt;&lt;strong&gt;PROBLEM I METODY BADAWCZE&lt;/strong&gt;: Problemy badawcze to próba odpowiedzi na następujące pytania: Jak menedżerowie zarządzający wielokulturowymi zespołami definiują „władzę”, którą wykorzystują w zarządzaniu ludźmi? Jakie źródła władzy oraz sposoby sprawowania władzy wykorzystują w praktyce zarządzania swoimi zespołami? Na jakie obszary zarządzania ludźmi w zróżnicowanych kulturowo zespołach ma istotny wpływ ich władza? Wykorzystane metody badawcze to przegląd literatury przedmiotu oraz odwołanie do wyników 24 indywidualnych wywiadów pogłębionych. &lt;br /&gt;&lt;strong&gt;PROCES WYWODU&lt;/strong&gt;: W części teoretycznej artykułu wyjaśniono pojęcie „władza” i przedstawiono źródła władzy wykorzystywane przez menedżerów w zarządzaniu ludźmi. W części badawczej zaprezentowano wyniki badań jakościowych (wywiadów przeprowadzonych z polskimi, hiszpańskimi i włoskimi menedżerami).&lt;/div&gt;
&lt;div style=&quot;text-align: justify;&quot;&gt;&lt;strong&gt;WYNIKI ANALIZY NAUKOWEJ&lt;/strong&gt;: W oparciu o literaturę przedmiotu oraz w nawiązaniu do wyników badań własnych, autorka wykazała, że władza menedżerów ma duże znaczenie, bowiem wpływa na pracowników oraz na różne obszary zarządzania ludźmi. Jest to szczególnie ważne w środowisku zróżnicowania kulturowego, gdzie pracownicy pochodzący z różnych kręgów kulturowych mogą mieć inną wrażliwość na wykorzystywane przez menedżerów źródła władzy oraz sposoby sprawowania przez nich władzy.&lt;/div&gt;
&lt;div style=&quot;text-align: justify;&quot;&gt;&lt;strong&gt;WNIOSKI, INNOWACJE, REKOMENDACJE&lt;/strong&gt;: Współczesne przedsiębiorstwa, działy personalne, a szczególnie menedżerowie odpowiedzialni za zarządzanie zespołami powinni zwracać szczególną uwagę na wykorzystywane źródła władzy i sposoby sprawowania władzy w praktyce organizacyjnej, wpływ władzy menedżerów na postawy i zachowania pracowników, ich motywację do pracy oraz decyzje podejmowane w różnych obszarach zarządzania ludźmi. Odpowiedzialność menedżerów za właściwe wykorzystywanie władzy w praktyce zarządzania ludźmi jest szczególnie ważna w środowisku zróżnicowania kulturowego pracowników.&lt;/div&gt;

&lt;p&gt;&lt;strong&gt;RESEARCH OBJECTIVE: &lt;/strong&gt;The aims of the article are to describe how manag­ers of different nationalities understand the concept of “power”, to identify the sources of their power and ways of exercising it, and to determine the impact of managers’ power on different areas of managing people in a culturally diverse work environment.&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;THE RESEARCH PROBLEM AND METHODS: &lt;/strong&gt;The research problems are an attempt to answer the following questions: How do managers who work with multicultural teams define “power”? What sources of power and ways of exercising power do they use in managing their teams? What areas of people management in culturally diverse teams are significantly influenced by their power? The research methods are a review of the subject literature and the results of 24 individual in-depth interviews.&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;THE PROCESS OF ARGUMENTATION: &lt;/strong&gt;The theoretical part of the article explains the term “power” and describes the sources of power used by managers in managing people. The research part reports the results of a qualitative study (interviews with the Polish, Spanish and Italian managers).&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;RESEARCH RESULTS: &lt;/strong&gt;Based on the subject literature and the results of the study, the author has demonstrated that managers’ power is of great importance as it affects employees and different areas of people management. This is very important in an environment of cultural diversity, in which employees from various cultural backgrounds can have different sensitivity to the sources of power used by managers.&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;CONCLUSIONS, INNOVATIONS, AND RECOMMENDATIONS: &lt;/strong&gt;Managers responsible for managing teams should pay special attention to the sources of power and the ways in which power is exercised, the impact of power on employees’ attitudes and behaviours, their motivation to work and the deci­sions taken in different areas of people management. Managers’ responsibility to use power appropriately is particularly important in work environment of cultural diversity.&lt;/p&gt;
